import * as React from 'react';
import { Typography, Link, Divider} from '@material-ui/core';
import {Fade} from 'react-reveal';

const Footer = (props) => {
  return (
    <div className='footer'>
      <Fade big>
        <Divider variant="middle" classes={{ root: props.classes.divider }} />
        <div className='footer-content'>
          <div></div>
          <div className='end'>
            <Link underline='hover' color='inherit'><Typography variant='h4'>John Zoscak</Typography></Link>
          </div>
          <div className='contact'>
            <Link underline='hover' color='inherit'>{'(703) 935-6163'}</Link>
            <Link underline='hover' color='inherit'>{'jzoscak02@gmail.com'}</Link>
          </div>
        </div>
      </Fade>
    </div>
  );
}
export default Footer;
